// C:\類D槽\Python\StockWeb\webtest\src\pages\Page1\HomeData\components\Data

import {React , useEffect, useState} from 'react'
import './Data.css'
import axios from 'axios'
function Data(){
    const [loginkey_data , setloginkey_data] = useState('');

    useEffect(()=>{
        async function GetData(){
            const response = await axios.get('http://localhost:5000/api/get_loginkey');
            setloginkey_data(response)
        }

    },[])
    return(
        <div>
            Data
        </div>
    );
}

export default Data;
